import React, { useState } from 'react';
import axios from 'axios';

const SignUp = () => {
  const [signUpData, setSignUpData] = useState({ email: '', pass: '' });

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!signUpData.email || !signUpData.pass) {
      alert('Please fill in both email and password fields.');
      return;
    }
    try {
      const response = await axios.post('/register', signUpData);
      console.log('Sign up successful:', response.data);
    } catch (error) {
      console.error('Error sending sign up data to API:', error.response?.data || error.message);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="bg-blue-400">
      <label className="email mr-4">
        Enter your email:
        <input
          type="text"
          value={signUpData.email} // Bind to email
          onChange={(e) => {
            console.log('Email input changed:', e.target.value);
            setSignUpData({ ...signUpData, email: e.target.value })}
          }
        />
      </label>

      <label className="pass mr-4">
        Enter your password:
        <input
          type="password"
          value={signUpData.pass} // Bind to pass
          onChange={(e) => {
            console.log('Password input changed:', e.target.value);
            setSignUpData({ ...signUpData, pass: e.target.value })}
          }
        />
      </label>

      <button type="submit">Sign Up</button>
    </form>
  );
};

export default SignUp;
